import React, { useEffect } from 'react';
import confetti from 'canvas-confetti';
import { FaTwitter, FaFacebookF, FaLinkedinIn } from 'react-icons/fa';

const ThankYouPage = () => {
  useEffect(() => {
    confetti({
      particleCount: 100,
      spread: 70,
      origin: { y: 0.6 }
    });
  }, []);

  return (
    <div className="flex justify-center items-center min-h-screen bg-gray-100">
      <div className="bg-white rounded-lg shadow-lg p-8 max-w-md w-full">
        <div className="text-center">
          <div className="mb-4">
            <div className="inline-block p-3 bg-green-100 rounded-full">
              <svg className="w-8 h-8 text-green-500" fill="none" stroke="currentColor" viewBox="0 0 24 24" xmlns="http://www.w3.org/2000/svg">
                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M5 13l4 4L19 7"></path>
              </svg>
            </div>
          </div>
          <h1 className="text-3xl font-bold mb-2">Thank You!</h1>
          <p className="text-gray-600 mb-6">
            Your onboarding form has been submitted successfully.
          </p>
          <div className="bg-blue-50 rounded-lg p-4 mb-6">
            <p className="text-blue-700">
              One of our team members will be in touch with you shortly. We're excited to have you join the Audiology Plus family!
            </p>
          </div>
          <button className="w-full bg-blue-600 text-white py-2 px-4 rounded-lg hover:bg-blue-700 transition duration-300 mb-6">
            Go to Dashboard â†’
          </button>
          <div>
            <p className="text-gray-600 mb-2">Share your excitement:</p>
            <div className="flex justify-center space-x-4">
              <button className="p-2 bg-gray-100 rounded-lg hover:bg-gray-200 transition duration-300">
                <FaTwitter className="text-gray-600" />
              </button>
              <button className="p-2 bg-gray-100 rounded-lg hover:bg-gray-200 transition duration-300">
                <FaFacebookF className="text-gray-600" />
              </button>
              <button className="p-2 bg-gray-100 rounded-lg hover:bg-gray-200 transition duration-300">
                <FaLinkedinIn className="text-gray-600" />
              </button>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default ThankYouPage;
